  [],\n\t\"revision_timestamp\": \"2015-05-07T03:47:31.606665\",\n\t\"name\": \"autonomous-navigation-in-gnss-denied-environments-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Aurora proposes to transition UMD methods
  for insect-inspired, lightweight vision- and optical sensor-based navigation methods
  for a combined air-ground system that leverages the unique capabilities of airborne
  systems  to achieve a progressively refined  map of the exploration region which
  can be accessed by agents within the autonomous team for localization, and by scientists
  and other ground observers.rnResearch during the Phase&amp;#150;I developed requirements,
  performed analyses and basic research that provided proof-of-concept demonstrations
  for navigational capabilities that will enhance the autonomous planetary and asteroid
  robotic exploration.rnrnTechniques derived from recent research were explored to
  demonstrate a concept for autonomous bio-inspired vision aided navigation to achieve
  navigation in GPS and magnetometer denied environments, generate obstacle maps and
  a 3 dimensional map of the environment based on optical flow and navigating to the
  origin of a map only based on optical flow input. This innovative research is providing
  a demonstration of the possibility of developing low size, weight and power solutions
  for vision based navigation by leveraging research on bio-inspired methodologies.
  rnrnDuring Phase-II further maturation of the algorithms, implementation on a higher
  fidelity simulation and prototypes and a conceptual design for a flight system will
  be pursued.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
